        content:
            "---\ntitle: el-form表单组件\ndate: 2019-06-06 14:11:35\ncategories: \n  - el-component\ntags: \n  - \ncomment: false\ncolumns: \n  - \n---\n# el-form表单组件\n\n## 前言\n\n想到当初对`el-form`表单如何实现有一些困惑，最近看着源码重现`el-form`组件，对表单实现有新的认识。\n\n### Form 表单\n\n下面是一份`el-form`示例代码\n\n```vue\n<template>\n  <el-form :model=\"ruleForm\" :rules=\"rules\" ref=\"ruleForm\">\n    <el-form-item label=\"名字\" prop=\"pass\">\n      <el-input type=\"password\" v-model=\"ruleForm.pass\"></el-input>\n    </el-form-item>\n    <el-form-item label=\"年龄\" prop=\"age\">\n      <el-input v-model.number=\"ruleForm.age\"></el-input>\n    </el-form-item>\n    <el-form-item>\n      <el-button type=\"primary\" @click=\"submitForm('ruleForm')\">提交</el-button>\n      <el-button @click=\"resetForm('ruleForm')\">重置</el-button>\n    </el-form-item>\n  </el-form>\n</template>\n\n<script>\nexport default {\n  data() {\n    return {\n      ruleForm: {\n        pass: '',\n        checkPass: '',\n        age: ''\n      },\n      rules: {\n        pass: [{ required: true, message: '请输入名字', trigger: 'blur' }],\n        age: [{ required: true, message: '请输入年龄', trigger: 'blur' }]\n      }\n    }\n  },\n  methods: {\n    submitForm(formName) {\n      this.$refs[formName].validate(valid => {\n        if (valid) {\n          alert('submit!')\n        } else {\n          console.log('error submit!!')\n          return false\n        }\n      })\n    },\n    resetForm(formName) {\n      this.$refs[formName].resetFields()\n    }\n  }\n}\n</script>\n```\n\n首先要清楚一下组件的使用方式\n\n1. `el-form`接收`model`和`rule`两个 prop\n   1. `model`表示表单绑定的数据对象\n   2. `rule`表示验证规则策略，表单验证\n2. `el-form-item`接收的`prop`属性，对应`form`组件的`model`数据中某个 key 值，如果 rule 刚好有 key，给定的条件下去如失去焦点验证规则匹不匹配。\n\n最终得到类似这样代码结构\n\n```vue\n<template>\n  <div>\n    <form @submit.prevent>\n      <div>\n        姓名\n        <input v-model=\"form.name\" />\n      </div>\n      <div>\n        年龄\n        <input v-model=\"form.age\" />\n      </div>\n      <div>\n        <button @click=\"submit\">提交</button>\n      </div>\n    </form>\n  </div>\n</template>\n```\n\n### 组件\n\n组件中嵌套组件，主要是通过`slot`插槽，可以将组件拼接成上面代码结构。代码如下\n\n**el-form**\n\n```vue\n<template>\n    <form>\n        <slot></slot>\n    </form>\n</template>\n<script>\nexport default {\n    name:'elForm'\n}\n</script>\n```\n\n**el-form-item**\n\n```vue\n<template>\n  <div>\n    <slot></slot>\n  </div>\n</template>\n<script>\nexport default {\n  name: 'elFormItem'\n}\n</script>\n```\n\n**el-input**\n\n```vue\n<template>\n  <input type=\"text\" />\n</template>\n<script>\nexport default {\n  name: 'elInput'\n}\n</script>\n```\n\n接下来就要考虑到组件中的通讯。\n由于组件中有可能嵌套很多的组件，如果单纯通过`$parent`和`$children`查找出来的父级组件，不一定是`el-form`组件。\n\n两个问题：\n\n- `el-form-item`组件如何得到`el-form`的数据\n- `el-form`组件如何和`el-form-item`进行交互\n\n解决第一问题，可以通过`provide`与`inject`实现。\n解决第二问题，就要讲到`dispatch`派发和`broadcast`广播\n\n#### provide 与 inject\n\n通过`provide`将当前表单实例传递到所有后代组件中，后代通过`inject`接受传递的值。\n\n**el-form**\n\n```vue\n<template>\n  <form><slot></slot></form>\n</template>\n<script>\nexport default {\n  name: 'elForm',\n  provide() {\n    return {\n      elForm: this\n    }\n  },\n  props: {\n    model: {\n      type: Object,\n      default: () => ({})\n    },\n    rules: Object\n  }\n}\n</script>\n```\n\n**el-form-item**\n\n```vue\n<template>\n    <div><slot></slot></div>\n</template>\n<script>\nexport default {\n    name:'elFormItem',\n    inject:['elForm'],\n    props:{\n        label:{\n            type:String,\n            default:''\n        },\n        prop:String\n    },\n    mounted(){\n       console.log(this.elForm)\n    }\n}\n</script>\n```\n\n`provide`中`this`指`el-form`组件，\n`this.elForm`就能得到`el-form`组件中的数据和方法。\n\n#### dispatch 和 broadcast 广播\n\n`$dispatch`与`$broadcast`是一种有历史的组件通信方式，因为他们是 Vue1.0 提供的一种方式，在 Vue2.0 中废弃了。\n\n`$dispatch`: `$dispatch`会向上触发一个事件，同时传递要触发的祖先组件的名称与参数，当事件向上传递到对应的组件上时会触发组件上的事件侦听器，同时传播会停止。\n\n`$broadcast`: `$broadcast`会向所有的后代组件传播一个事件，同时传递要触发的后代组件的名称与参数，当事件传递到对应的后代组件时，会触发组件上的事件侦听器，同时传播会停止（因为向下传递是树形的，所以只会停止其中一个叶子分支的传递）\n\n**$dispatch**\n\n```js\n/**\n * 派发 (向上查找) (一个)\n * @param componentName // 需要找的组件的名称\n * @param eventName // 事件名称\n * @param params // 需要传递的参数\n */\n    dispatch(componentName, eventName, params) {\n        let parent = this.$parent || this.$root;//$parent 找到最近的父节点 $root 根节点\n        let name = parent.$options.name; // 获取当前组件实例的name\n        // 如果当前有节点 && 当前没名称 且 当前名称等于需要传进来的名称的时候就去查找当前的节点\n        // 循环出当前名称的一样的组件实例\n        while (parent && (!name||name!==componentName)) {\n            parent = parent.$parent;\n            if (parent) {\n                name = parent.$options.name;\n            }\n        }\n        // 有节点表示当前找到了name一样的实例\n        if (parent) {\n            parent.$emit.apply(parent,[eventName].concat(params))\n        }\n    },\n```\n\n**$broadcast**\n\n```js\n/**\n * 派发 (向上查找) (一个)\n * @param componentName // 需要找的组件的名称\n * @param eventName // 事件名称\n * @param params // 需要传递的参数\n */\nbroadcast(componentName, eventName, params) {\n// 循环子节点找到名称一样的子节点 否则 递归 当前子节点\nthis.$children.map(child=>{\n    if (componentName===child.$options.name) {\n        child.$emit.apply(child,[eventName].concat(params))\n    }else {\n        broadcast.apply(child,[componentName,eventName].concat(params))\n    }\n})\n```\n\n**验证表单**\n\n`async-validator`是一个表单的异步验证的第三方库，也是`element-ui` 中的`form`组件所使用的验证方式。\n\n**el-form-item**\n\n```vue\n<template>\n  <div>\n    <label v-if=\"label\">{{ label }}</label>\n    <slot></slot>\n    {{ errorMessage }}\n  </div>\n</template>\n<script>\nimport Schema from 'async-validator'\nexport default {\n  name: 'elFormItem',\n  inject: ['elForm'],\n  props: {\n    label: {\n      type: String,\n      default: ''\n    },\n    prop: String\n  },\n  data() {\n    return { errorMessage: '' }\n  },\n  mounted() {\n    this.$on('validate', () => {\n      if (this.prop) {\n        let rule = this.elForm.rules[this.prop]\n        let newValue = this.elForm.model[this.prop]\n\n        let descriptor = {\n          [this.prop]: rule\n        }\n        let schema = new Schema(descriptor)\n\n        return schema.validate({ [this.prop]: newValue }, (err, res) => {\n          if (err) {\n            this.errorMessage = err[0].message\n          } else {\n            this.errorMessage = ''\n          }\n        })\n      }\n    })\n  }\n}\n</script>\n```\n",
